import React from 'react'
import {
    NavbarContainer,
    NavbarLogo
} from './navbarElements'

const Navbar = () => {
    return (
        <>
        <NavbarContainer>
            <NavbarLogo>
                <h1>Logo</h1>
            </NavbarLogo>
        </NavbarContainer>
        </>
    )
}

export default Navbar;
